import React from 'react';
import s from './Navbar.module.css'
import {NavLink} from 'react-router-dom'

const Navbar = (props) => {
let navbarItem=props.state.map((el)=>(<div  className={s.item}><NavLink to={el.path} activeClassName={s.activeLink}>{el.item}</NavLink>
    </div>))
    return (<nav className={s.nav}>
            {navbarItem}
    </nav>)
}

export default Navbar;
